package com.carama.app.guinges.utils;public class ScrollableTableModelException extends RuntimeException{  public ScrollableTableModelException()  {    super();  }  public ScrollableTableModelException(String message)  {    super(message);  }  public ScrollableTableModelException(Throwable cause)  {    super(cause);  }  public ScrollableTableModelException(String message, Throwable cause)  {    super(message, cause);  }}